// Forzamos a obtener todos los ítems del nodo Loop
const loopItems = $("Loop Over Items1").all();
const results = [];

for (const item of loopItems) {
  const loopData = item.json;

  // Obtenemos los datos de Postgres para comparar
  // Si hay muchos registros, esto comparará contra el PRIMERO que encuentre el nodo Postgres
  const dbNode = $("Reservas Postgres").first();
  if (!dbNode) continue;
  const dbData = dbNode.json;

  // --- FORMATEO DE FECHA Y HORA ---
  let fechaDb = dbData.fecha_reservacion?.split('T')[0];
  let horaDb = dbData.hora_reservacion?.substring(0, 5); // De "21:00:00" a "21:00"

  // --- MAPEO DE COMPARACIÓN ---
  const mapping = {
    "Código": dbData.codigo_reserva,
    "Nombre": dbData.cliente,
    "Fecha": fechaDb,
    "Personas": dbData.numero_personas?.toString(),
    "Zona": dbData.zona,
    "Teléfono": dbData.telefono_contacto,
    "Estado": dbData.estado,
    "Notas": dbData.notas,
    "Hora": horaDb
  };

  let hasChanged = false;

  for (const [key, valDb] of Object.entries(mapping)) {
    const valLoop = loopData[key]?.toString().trim();
    const valDbStr = valDb?.toString().trim();

    if (valLoop !== valDbStr) {
      hasChanged = true;
      break; 
    }
  }

  // SI HAY CAMBIOS: Devolvemos el JSON exacto del Loop
  if (hasChanged) {
    results.push({ json: loopData });
  }
}

return results;

